package cn.com.phinfo.protocol;import java.util.List;import java.util.Stack;import com.alibaba.fastjson.JSON;import com.heqifuhou.protocolbase.HttpResultBeanBase;import com.heqifuhou.protocolbase.QuickRunObjectBase;public class UserInfoRun extends QuickRunObjectBase {	public UserInfoRun() {		super(LURLInterface.GET_URL_USERINFO(),null,UeserInfoResultBean.class);	}		public static class UeserInfoResultBean extends HttpResultBeanBase{		private List<ItemUserInfo> data = new Stack<ItemUserInfo>();		public List<ItemUserInfo> getData() {			return data;		}		public void setData(List<ItemUserInfo> data) {			this.data = data;		}			}	public static class ItemUserInfo{		private String fullName;		private String mobile;		private String nickName;		private String deptName;		private String emailAddress;		private String jobTitle;		private String postName;		private String fax;		public String getFullName() {			return fullName;		}		public void setFullName(String fullName) {			this.fullName = fullName;		}		public String getMobile() {			return mobile;		}		public void setMobile(String mobile) {			this.mobile = mobile;		}		public String getNickName() {			return nickName;		}		public void setNickName(String nickName) {			this.nickName = nickName;		}		public String getDeptName() {			return deptName;		}		public void setDeptName(String deptName) {			this.deptName = deptName;		}		public String getEmailAddress() {			return emailAddress;		}		public void setEmailAddress(String emailAddress) {			this.emailAddress = emailAddress;		}		public String getJobTitle() {			return jobTitle;		}		public void setJobTitle(String jobTitle) {			this.jobTitle = jobTitle;		}		public String getPostName() {			return postName;		}		public void setPostName(String postName) {			this.postName = postName;		}		public String getFax() {			return fax;		}		public void setFax(String fax) {			this.fax = fax;		}	}}